import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";
import { loadSlim } from "tsparticles-slim";
import { useCallback, useMemo } from "react";

const ParticlesComponent = () => {
    const options = useMemo(() => {
        return {
            "emitters": [
                {
                  "position": {
                    "x": 0,
                    "y": 30
                  },
                  "rate": {
                    "quantity": 5,
                    "delay": 0.15
                  },
                  "particles": {
                    "move": {
                      "direction": "top-right",
                      "outModes": {
                        "top": "none",
                        "left": "none",
                        "default": "destroy"
                      }
                    }
                  }
                },
                {
                  "position": {
                    "x": 100,
                    "y": 30
                  },
                  "rate": {
                    "quantity": 5,
                    "delay": 0.15
                  },
                  "particles": {
                    "move": {
                      "direction": "top-left",
                      "outModes": {
                        "top": "none",
                        "right": "none",
                        "default": "destroy"
                      }
                    }
                  }
                }
              ],
              "particles": {
                "color": {
                  "value": [
                    "#ffffff",
                    "#FF0000"
                  ]
                },
                "move": {
                  "decay": 0.05,
                  "direction": "top",
                  "enable": true,
                  "gravity": {
                    "enable": true
                  },
                  "outModes": {
                    "top": "none",
                    "default": "destroy"
                  },
                  "speed": {
                    "min": 10,
                    "max": 30
                  }
                },
                "number": {
                  "value": 0
                },
                "opacity": {
                  "value": 1
                },
                "rotate": {
                  "value": {
                    "min": 0,
                    "max": 360
                  },
                  "direction": "random",
                  "animation": {
                    "enable": true,
                    "speed": 30
                  }
                },
                "tilt": {
                  "direction": "random",
                  "enable": true,
                  "value": {
                    "min": 0,
                    "max": 360
                  },
                  "animation": {
                    "enable": true,
                    "speed": 30
                  }
                },
                "size": {
                  "value": {
                    "min": 0,
                    "max": 2
                  },
                  "animation": {
                    "enable": true,
                    "startValue": "min",
                    "count": 1,
                    "speed": 16,
                    "sync": true
                  }
                },
                "roll": {
                  "darken": {
                    "enable": true,
                    "value": 25
                  },
                  "enable": true,
                  "speed": {
                    "min": 5,
                    "max": 15
                  }
                },
                "wobble": {
                  "distance": 30,
                  "enable": true,
                  "speed": {
                    "min": -7,
                    "max": 7
                  }
                },
                "shape": {
                  "type": [
                    "circle",
                    "square"
                  ],
                  "options": {}
                }
              }
            
        }
    }, [])

    const particlesInit = useCallback((engine) => {
        loadFull(engine)
    }, [])

    return <Particles init={particlesInit} options={options}/>
}

export default ParticlesComponent;
